import React from 'react';
import {
  Text,
  View,
  StyleSheet,
} from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // justifyContent: 'center',
    backgroundColor: 'lightblue', // '#ecf0f1',
    padding: 8,
    paddingTop: 50,
  },
  heading: {
    margin: 24,
    fontSize: 18,
    fontWeight: 'bold',
    textAlign: 'center',
  },
});

function App() {
  return (
    <View style={styles.container}>
      <Text style={styles.heading}>
        Change code in the editor
      </Text>
      <View>
        <Button
          title="Go to Details... again"
          onPress={() => navigation.push('Details', {
            cardId: cardId + 1,
          })}
        />

      </View>
    </View>
  );
}

export default App;
